import React from "react";
import styled from 'styled-components'

const ul = styled.ul`
    list-style: none;
    display: flex;
    flex-flow: row nowrap;

  li {
    padding: 18px 10px
  }
`

const RightNav = () => {
    return (
        <ul>
        <li>Home</li>
        <li>SignUp</li>
        <li>login</li>
        <li>Search</li>
        <li>About</li>
      </ul>
    )
}

export default RightNav;
